import React from "react";
import { Card} from "react-bootstrap";
import Header from "./Header";
const MainHome = () => {
  return (
    <div>
      <Header/>
      <Card
        className="text-white"
        variant="light"
        style={{
          width: "100vw",
          height: "25vh",
          fontSize: "100px",
          textAlign: "center",
          backgroundColor: "grey",
        }}
      >
        The Generics
      </Card>
    </div>
  );
};

export default MainHome;
